  \"Availability of contaminants to migratory shorebirds consuming horseshoe crab
  eggs on Delaware Bay Beaches\",\n\t\"tracking_summary\": {\n\t\t\"total\": 17,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2014-04-24T15:02:56.363242\",\n\t\"name\": \"availability-of-contaminants-to-migratory-shorebirds-consuming-horseshoe-crab-eggs-on-dela\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A perceived decline in the shorebird population
  has raised concern regarding contamination at shorebird breeding, staging, and wintering
  grounds. Thousands of shorebirds utilize Delaware Bay as the final staging ground
  during their migration to breeding areas in northern Canada. The abundance of horseshoe
  crab eggs on the beaches of Delaware Bay provides a plentiful food source for shorebirds.
  Shorebirds consume enough horseshoe crab eggs to double or triple their weight during
  the two to three weeks stopover at Delaware Bay. Horseshoe crab eggs, sand, and
  ruddy turnstones were collected at two beaches on the Delaware shore of Delaware
  Bay and analyzed for organochlorines and trace metals to determine whether the horseshoe
  crab eggs are a potential source of contamination to the shorebirds. Sand, eggs,
  and bird tissues contained background to moderately elevated levels of contaminants.
  This limited study indicates that contamination of the shorebirds at Delaware Bay
  is probably not responsible for any decline in the population. However, a more extensive
  survey of horseshoe crab eggs throughout Delaware Bay would provide a more reliable
  assessment.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
